import './App.css';
import MultiSelector from './Components/MultiSelector';
function App() {
  return (
    <div className="App">
      <h1>Multiple Checkbox Select</h1>
      <header className="App-header">
        <MultiSelector />
      </header>
    </div>
  );
}

export default App;
